// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract P2PLoanify {
    address payable public lender;
    uint public balance;

    constructor() payable {
        lender = payable(msg.sender);
        balance = msg.value;
    }

    function lend(uint256 amount) payable public {
        require(amount > 0, "Amount must be greater than 0");
        balance += amount;
    }

    function repay(uint256 amount) payable public {
        require(amount > 0, "Amount must be greater than 0");
        require(msg.sender == lender, "Only lender can repay the loan");
        require(amount <= balance, "Cannot repay more than the loan amount");
        balance -= amount;
        if (balance == 0) {
            selfdestruct(lender);
        }
    }
}

